import React from "react";
import Header from "./Header/Header";

import { ShopDisplay } from "./Shop/ShopDisplay";

import Footer from "./Footer/footer";

const Shop = () => {
  return (
    <>
      <Header />
      <ShopDisplay />
      <Footer />
    </>
  );
};

export default Shop;
